                        <table className={classes.tableCurrentWeather}>
                            <tr>
                                <td className={classes.td1}>67<sup>o</sup>F</td>
                            </tr>
                            <tr>
                                <td className={classes.td2}>Feels like 65<sup>o</sup></td>
                            </tr>
                            <tr>
                                <td>__________________________________</td>
                            </tr>
                        </table>
                </ExpansionPanelSummary>
                <ExpansionPanelDetails>
                    <table className={classes.tableDayWeather}>
                        <tr>
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />
                            <SunIcon />


                        </tr>
                    </table>


                </ExpansionPanelDetails>
            </ExpansionPanel>
            <SimpleBottomNavigation />
            {/*ReactDOM.render(<SimpleBottomNavigation />, document.getElementById('root'));*/}
        </div>
    );
}

SimpleExpansionPanel.propTypes = {
    classes: PropTypes.object.isRequired,
};

export default withStyles(styles)(SimpleExpansionPanel);
